import React from "react";
import { Container, Row, Col } from "react-bootstrap";
function Header() {
  return (
    <Header>
      <Container>
        <Row>
          <Col xxl={8}>sm=8</Col>
          <Col xxl={4}>sm=4</Col>
        </Row>
      </Container>
    </Header>
  );
}
export default Header;
